import React, { useState } from "react";
import "./reset.css";
import "./App.css";

import Header from "./Components/Header/Header";
import Main from "./Components/Main/Main";
import Footer from "./Components/Footer/Footer";
import jsonData from "./beastData.json";

function App() {
  const [faves, setFaves] = useState(0);

  function updateFaves() {
    setFaves(faves + 1);
  }

  return (
    <div className="App">
      <Header />
      <Main beastData={jsonData} updateFaves={updateFaves} />
      <Footer />
    </div>
  );
}

export default App;
